define({"topics" : [{"title":"Initial registration","shortdesc":"\n               <p class=\"shortdesc\">When you install an enforcer, the installation wizard prompts you for an ICENet         server to connect to. This does not\n                  necessarily represent the ICENet server the enforcer         always connects to, but rather the one it connects to the first\n                  time it starts up, to         register itself with the Control Center. \n               </p>\n            ","href":"initial_registration.html","attributes": {"data-id":"initial_registration",},"menu": {"hasChildren":false,},"tocID":"initial_registration-d66e1486","topics":[]},{"title":"Relationships of profiles ICENet servers, and hosts","shortdesc":"\n               <p class=\"shortdesc\">Enforcer profiles, ICENet Servers, and hosts have these relationships.</p>\n            ","href":"relationships_of_profiles_icenet_servers__and_hosts.html","attributes": {"data-id":"relationships_of_profiles_icenet_servers__and_hosts",},"menu": {"hasChildren":false,},"tocID":"relationships_of_profiles_icenet_servers__and_hosts-d66e1497","topics":[]},{"title":"Load-balanced or clustered ICENet servers","shortdesc":"\n               <p class=\"shortdesc\">As far as profiles are concerned, each cluster of ICENet servers behaves like a         single server.</p>\n            ","href":"load_balanced_or_clustered_icenet_servers.html","attributes": {"data-id":"load_balanced_or_clustered_icenet_servers",},"menu": {"hasChildren":false,},"tocID":"load_balanced_or_clustered_icenet_servers-d66e1508","topics":[]},{"title":"Moving profiles between ICENet servers","href":"moving_profiles_between_icenet_servers.html","attributes": {"data-id":"moving_profiles_between_icenet_servers",},"menu": {"hasChildren":false,},"tocID":"moving_profiles_between_icenet_servers-d66e1519","topics":[]}]});